import { useEffect, useState } from 'react';
import './App.css';
import axios from './axios';

const [pokemon, setPokemon] = useState([]);

const fetchPokemon = () => {
  try {
    let response = axios.get('http://localhost:5000/api/v1/pokemon/');
    console.log(response);
  }catch(err) {
    console.log(err);
  }
}

useEffect(() => {
  fetchPokemon();
}, []);

function App() {
  return (
    <div className="App">
      Hello World
    </div>
  );
}

export default App;
